jQuery.fn.dataTable.render.ellipsis = function ( cutoff, wordbreak, escapeHtml ) {
    var esc = function ( t ) {
        return t
            .replace( /&/g, '&amp;' )
            .replace( /</g, '&lt;' )
            .replace( />/g, '&gt;' )
            .replace( /"/g, '&quot;' );
    };
 
    return function ( d, type, row ) {
        if (d.includes("href")) {
            walx = $(d).text();
            attrx = $(d).attr("href");

            var shortened = walx.substr(0, cutoff);
            var n_walx = walx.length;
            if(n_walx > cutoff){
                shortened += '...';
            }

            return '<a  href="'+attrx+'" class="ellipsis" data-toggle="tooltip" title="'+walx+'" target="blank">'+shortened+'</a>';
        } else{
            // Order, search and type get the original data
            if ( type !== 'display' ) {
                return d;
            }
    
            if ( typeof d !== 'number' && typeof d !== 'string' ) {
                return d;
            }
    
            d = d.toString(); // cast numbers
    
            if ( d.length <= cutoff ) {
                return d;
            }
    
            var shortened = d.substr(0, cutoff);
    
            // Find the last white space character in the string
            if ( wordbreak ) {
                shortened = shortened.replace(/\s([^\s]*)$/, '');
            }
    
            // Protect against uncontrolled HTML input
            if ( escapeHtml ) {
                shortened = esc( shortened );
            }
            return '<span class="ellipsis" title="'+esc(d)+'">'+shortened+'&#8230;</span>';
        }
        
    };
};